inputs = ["",
         "",
         "",
         "",
         ""]


class Grid_class
  def initialize
    @gridX = 0
    @gridY = 2
    @grid = [[nil,nil,"1",nil,nil],
             [nil,"2","3","4",nil],
             ["5","6","7","8","9"],
             [nil,"A","B","C",nil],
             [nil,nil,"D",nil,nil]]
  end
  def return_num
    @grid[@gridY][@gridX]
  end
  def check_bounds
    @gridX = 0 if @gridX == -1
    @gridY = 0 if @gridY == -1
    @gridX = 4 if @gridX == @grid.length
    @gridY = 4 if @gridY == @grid.length
  end
  def move direction
    old_X = @gridX
    old_Y = @gridY
    case direction
    when "L" then @gridX -= 1
    when "R" then @gridX += 1
    when "U" then @gridY -= 1
    when "D" then @gridY += 1
    end
    check_bounds
    if return_num.nil?
      @gridX = old_X
      @gridY = old_Y
    end
  end
end

grid = Grid_class.new
inputs.each do |input| # each row
  input.chars.each do |char|
    grid.move(char)
  end
  print grid.return_num
end
